import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Homepage from './pages/Homepage';
import './App.css';

class App extends Component {
	render() {
		return (
			<Router>
				<div className="App">
					<Homepage />
				</div>
			</Router>
		);
	}

}

export default App;
